import { useState } from "react";

function ShowingVideos(props) {
  const [videos, setVideos] = useState(props.result);
  return (
    <>
      {videos.map((video) => (
        <iframe
          width="702"
          height="395"
          src="https://www.youtube.com/embed/xNRJwmlRBNU"
          title="How To Embed YouTube Videos in React / Gatsby (and make them Responsive)"
          frameborder="0"
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share"
          allowfullscreen
        ></iframe>
      ))}
    </>
  );
}

export default ShowingVideos;
